webpackJsonp([16],{"./node_modules/json-loader/index.js!./.cache/json/posts-2017-04-21-building-a-blog-with-gatsby-js.json":function(t,e){t.exports={data:{site:{siteMetadata:{title:"Nate A Taylor",author:"Nate A Taylor"}},markdownRemark:{id:"/Users/nate/Workspace/nate-site/src/posts/07-21-2017---building-a-blog-with-gatsby-js.md absPath of file >>> MarkdownRemark",html:'<p><a href="https://www.gatsbyjs.org/">Gatsby</a> is a static site generator build with React, Redux, and Webpack.\nLike <a href="https://jekyllrb.com/">Jeckyll</a>, with modern JS instead of Ruby.</p>\n<p>In the next few posts, we’ll walkthough how to set up your own website/blog using Gatsby.</p>\n<p>Things we’ll cover</p>\n<ul>\n<li>Initializing a new static site</li>\n<li>Adding new pages</li>\n<li>Creating Layouts</li>\n<li>Adding markdown support / automatic post creation for markdown files</li>\n<li>Deploying to Github Pages</li>\n</ul>\n<p>Much of this is layed out in the <a href="https://www.gatsbyjs.org/docs/">official documentation</a>.\nUnfortunately, since this is relatively new project, there are still some holes.</p>\n<h2 id="prerequisites"><a href="#prerequisites" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Prerequisites</h2>\n<p>You’ll need</p>\n<ul>\n<li>Familiarity with ES6 JavaScript</li>\n<li><a href="https://nodejs.org/en/">Node</a> and NPM installed</li>\n</ul>\n<h2 id="initializing-the-project"><a href="#initializing-the-project" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Initializing the Project</h2>\n<p>First you’ll need to install Gatsby</p>\n<div class="gatsby-highlight">\n      <pre class="language-sh"><code>npm install -g gatsby</code></pre>\n      </div>\n<p>Then use it to create a new project</p>\n<div class="gatsby-highlight">\n      <pre class="language-sh"><code>gatsby new <site-name></code></pre>\n      </div>',frontmatter:{title:"Building a Blog with Gatsby JS",summary:"How to build a personal site with Gatsby",tags:["JavaScript","React","Tutorial"],date:"April, 21, 2017"}}},pathContext:{slug:"/posts/2017/04/21/building-a-blog-with-gatsby-js/"}}}});
